To create a React and Node.js/Express.js web app for creating or adding dummy data, showing it, and deploying it on Heroku or any other free platform, you can follow these steps:

1. Set up the project:
   - Create a new directory for your project.
   - Open a terminal and navigate to the project directory.
   - Run `npx create-react-app client` to create a new React app in a "client" directory.
   - Create a new file named `server.js` in the project root directory.

2. Set up the server:
   - In the project root directory, run `npm init -y` to initialize a new Node.js project.
   - Install the necessary dependencies by running `npm install express cors`.
   - Open the `server.js` file and add the following code:

     ```javascript
     const express = require('express');
     const cors = require('cors');

     const app = express();
     app.use(cors());
     app.use(express.json());

     // Dummy data
     let data = [
       { id: 1, name: 'John Doe' },
       { id: 2, name: 'Jane Smith' },
     ];

     // GET route to retrieve data
     app.get('/api/data', (req, res) => {
       res.json(data);
     });

     // POST route to add new data
     app.post('/api/data', (req, res) => {
       const newData = req.body;
       data.push(newData);
       res.status(201).json(newData);
     });

     const port = process.env.PORT || 5000;
     app.listen(port, () => {
       console.log(`Server is running on port ${port}`);
     });
     ```

3. Set up the React app:
   - Navigate to the "client" directory.
   - Install the necessary dependencies by running `npm install axios`.
   - Open the `src/App.js` file and replace its contents with the following code:

     ```jsx
     import React, { useState, useEffect } from 'react';
     import axios from 'axios';

     function App() {
       const [data, setData] = useState([]);
       const [newName, setNewName] = useState('');

       useEffect(() => {
         fetchData();
       }, []);

       const fetchData = async () => {
         const response = await axios.get('/api/data');
         setData(response.data);
       };

       const handleSubmit = async (e) => {
         e.preventDefault();
         const newId = data.length + 1;
         const newData = { id: newId, name: newName };
         await axios.post('/api/data', newData);
         setData([...data, newData]);
         setNewName('');
       };

       return (
         <div>
           <h1>Dummy Data</h1>
           <ul>
             {data.map((item) => (
               <li key={item.id}>{item.name}</li>
             ))}
           </ul>
           <form onSubmit={handleSubmit}>
             <input
               type="text"
               value={newName}
               onChange={(e) => setNewName(e.target.value)}
             />
             <button type="submit">Add</button>
           </form>
         </div>
       );
     }

     export default App;
     ```

